window.bookSummaryJSON = "<p><b>One moment. Two masks. Three chases into the night.</b></p> <p>They're supposed to be enemies. It takes one night with a masked man to change that all.</p> <p>They crave the next touch of the person they hate the most. Desperate for that next taste of the person they can't stand. Waiting for that anonymous text message to accelerate their heartbeats. The thrill of the chase with the forbidden fruit is enough to blur the lines and the world around them.</p> <p>The first problem? They both have girlfriends.</p> <p>The worst problem? They're stepbrothers.</p> <p><i>This is a very dark MM romance for mature listeners.</i></p>"; 
